INSERT INTO `auctions` VALUES (36,'Amazfit Bip Smart Watch Heart & Sleep Monitor 1.28â€ Fitness Tracker - Orange','Record-breaking battery life: Up to 30 days with regular use and up to 45 days with minimal notifications.\r\nSuper light weight: Comfortable to wear every day, as well as for sports and sleep tracking.\r\nNotifications: Receive notifications for calls, messages, emails, and other apps on the color touch display.\r\nMultisport tracking: Track your runs, cycling and more with mapped routes, detailed stats and heart rate zones.\r\nLatest technology: GPS, 3-axis accelerometer, optical heart rate sensor, barometer and compass.\r\nAlways-on display: the reflective color touch screen is always on and provides at-a-glance view for time, date, steps, weather, sports stats etc.','Electronics',20,30,'2022-11-30 11:11:00',3,20,1,NULL,_binary ''),(37,'Timberland Newmarket Archive Rugged Arch Classic Urban Hiker Chukka Boots','Perfect for accompanying any outfit, the mens Timberland Newmarket Archive Boot combines the ultimate comfort with on-trend design that will stand out in a crowd. These robust boots feature an urban styled silhouette with intricate stitch detailing with an up-hiker style D-Ring construction. The soft padded insoles will help to absorb shock and return energy to your feet with every step, perfect for long days out and about.','Clothes',60,70,'2022-12-30 00:00:00',3,60,1,NULL,_binary ''),(38,'Apple iPhone 11 64GB Unlocked Smartphone Good Condition Warranty','','Electronics',220,250,'2022-12-30 00:00:00',3,220,1,NULL,_binary ''),(39,'Panda 100% Bamboo Duvet Cover (REJUVENATED)','Pandaâ€™s silky, soft Bamboo Bedding wraps you in smooth, dreamy comfort. The breathable fabric glides over your skin, only getting softer with every wash! Bamboo is temperature intuitive, naturally preventing overheating while its hypoallergenic and antibacterial qualities gently protect skin from irritation. The perfect bedding for night after night of luxuriously indulgent sleep.\r\n\r\nBeautifully Soft & Breathable â€“ Smooth, silky bamboo feels indulgently soft night after night.\r\n\r\nTemperature Intuitive â€“ Bamboo reacts naturally to your body temperature, keeping you cool in summer and oh-so-cosy throughout winter.\r\n\r\nHypo-allergenic â€“ Bamboo is naturally hypoallergenic, gently protecting against skin irritation and allergies for cool, comfortable sleep. Ideal for those suffering with eczema and sensitive skin.\r\n\r\nAnti-bacterial â€“ Bamboo is inhospitable to dust mites and parasites keeping bedtime fresh and protecting skin from bacteria.\r\n\r\nOdour-Resistant â€“ Super absorbent bamboo wicks away moisture and odours for fresh, cool sleep.','Others',30,40,'2022-12-30 00:00:00',3,35,1,4,_binary ''),(41,'Regatta Mens Salinger III Waterproof Insulated Faux Fur Hooded Parka Jacket Coat','Isotex: Waterproof, breathable and windproof membrane technology\r\nThermoguard: Quick dry synthetic fibre insulation that traps air\r\nPull on the hood with stylish faux fur trim. It\'s a winter wardrobe staple\r\nThermoguard insulation to see off cold temperatures\r\n100% Polyester','Clothes',52,60,'2022-12-30 00:00:00',3,52,1,4,_binary ''),(42,'LUMINOX SEA LION X2.2079 CARBONOX MEN\'S 100M BLACK /ORANGE 38MM WATCH NEW','Luxdiscountwarehouse LUMINOX X2.2079 WATCH Watch Details: SERIES - 2070 SUITABLE FOR SMALL WRIST SIZE Case Width: 38 mm approx Case Depth: 13 mm approx Case Material: Carbonox Dial Colour: Orange  Movement: Swiss Made Ronda Quartz Movement . Features: Date Display , Uni Directional Rotating Bezel, Luminous(Night Vision ) Hands & Markers , Double Security Gasket . Strap Type: Rubber Strap Colour: Black Strap Size: Men\'s Standard Strap Width: 20 mm Clasp Type: Pin & Buckle Glass Type: Hardened Mineral Crystal Water Resistant: 10 ATM Packaging: Official luminox Boxes ,Manuals , Warranty Card international . Warranty Type: 2 Years Watch Movement (critical failure of the movement) Model Ref: X2.2079 All watches sold are sourced from official B2B wholesalers and distributors only {VAT registration number -(GB290400726) required} and so are guaranteed authentic models PAYMENT We only accept payment via PayPal or Credit Card payment via PayPal. (You do not need a PayPal account to pay). Your address must be confirmed. Buyers who pay with unconfirmed addresses will not be accepted and will be asked to cancel their purchase; a full refund will be issued. We expect to receive your payment within 07 days after you commit to buy the item. If you have any special request, please email us before buying. SHIPPING, PACKAGING AND WARRANTY SHIPPING: All the Items order before 02:00 pm will ship on the same day with sign required Royal mail/Hermes/Dpd/Fedex - Free Shipping Warranty Information: Luminox watches are covered by our own 2 year watch movement warranty (critical failure of the movement) with the warranty booklet stamped and dated on the day of posting. The warranty does not cover, servicing, batteries straps (including clasp) glass, scratches arising from accidental damage or normal wear or from any alterations or from water damage arising from miss use. Purchase with Confidence: All watches sold are the authentic article, have our 2 year watch movement warranty and come with official branded packaging. The photos in the listing are taken from one of the actual watches in stock and are not standard stock images. ','Electronics',156,170,'2022-12-02 15:10:00',3,171,1,4,_binary '');
